/// Unicode character categories.
#[derive(PartialEq)]
enum CharacterCategory {
    /// No character category is defined.
    None,
    /// Letter, Uppercase (LU).
    LetterUppercase,

    /// Letter, Lowercase. (LL).
    LetterLowercase,

    /// Letter, TitleCase. (LT).
    LetterTitleCase,

    /// Letter, Modifier (LM).
    LetterModifier,

    /// Letter, Other (LO).
    LetterOther,

    /// Mark, NonSpacing (MN).
    MarkNonSpacing,

    /// Mark, Spacing Combining (MC).
    MarkSpacingCombining,

    /// Mark, Enclosing (ME).
    MarkEnclosing,

    /// Number, Decimal Digit (ND).
    NumberDecimalDigit,

    /// Number, Letter (NL).
    NumberLetter,

    /// Number, Other (NO).
    NumberOther,

    /// Punctuation, Connector (PC).
    PunctuationConnector,

    /// Punctuation, Dash (PD).
    PunctuationDash,

    /// Punctuation, Open (PS).
    PunctuationOpen,

    /// Punctuation, Close (PE).
    PunctuationClose,

    /// Punctuation, Initial Quote (PI). May behave like PS or PE depending on usage.
    PunctuationInitialQuote,

    /// Punctuation, Final Quote (PF). May behave like PS or PE depending on usage.
    PunctuationFinalQuote,

    /// Punctuation, Other (PO).
    PunctuationOther,

    /// Symbol, Math (SM).
    SymbolMath,

    /// Symbol, Currency (SC).
    SymbolCurrency,

    /// Symbol, Modifier (SK).
    SymbolModifier,

    /// Symbol, Other (SO).
    SymbolOther,

    /// Separator, Space (ZS).
    SeparatorSpace,

    /// Separator, Line (ZL).
    SeparatorLine,

    /// Separator, Paragraph (ZP).
    SeparatorParagraph,

    /// Other, Control (CC).
    OtherControl,

    /// Other, Format (CF).
    OtherFormat,

    /// Other, Surrogate (CS).
    OtherSurrogate,

    /// Other, Private Use (CO).
    OtherPrivateUse,
    // Other, Not Assigned (CN). No characters in the file have this property.
    // OtherNotAssigned,
}

